import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("EBGaramond-normal.ttf", font);
  this.addFont("EBGaramond-normal.ttf", "EBGaramond", "normal");
  this.addFont("EBGaramond-normal.ttf", "EBGaramond", "bold");
  this.addFont("EBGaramond-normal.ttf", "EBGaramond", "italic");
  this.addFont("EBGaramond-normal.ttf", "EBGaramond", "bolditalic");
};
jsPDF.API.events.push(["addFonts", callAddFont]);
